(452, 11, 2, 'SPIDER MID RED/BLUE', 'Mid - Cut, Bahan PVC, Sol Rubber, Sepatu Velcro', '<p>\r\n	   Precise Spider Mid adalah Sepatu Anak - Merah/Biru, merupakan sepatu yang diproduksi oleh Precise.Terbuat dari bahan PVC yang dilengkapi dengan sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan dasar yang digunakan dalam membuat sepatu ini merupakan material-material pilihan yang berkualitas sehingga sepatu menjadi awet dan tidak mudah rusak.Desainnya yang kasual membuat sepatu ini cocok untuk menemani segala bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
