(589, 47, 2, 'ALPHARD RED/NAVY ', 'Mid - Cut, Bahan PVC, Sol Rubber, Sepatu Vreco', '<p>\r\n	    Precise Alphard adalah Sepatu Anak - Merah/Navy, merupakan sepatu velcro  yang diproduksi oleh Precise.Terbuat dari bahan PVC yang dilengkapi dengan sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan dasar yang digunakan dalam membuat sepatu ini merupakan material-material pilihan yang berkualitas sehingga sepatu menjadi awet dan tidak mudah rusak. Desainnya yang kasual membuat sepatu ini cocok untuk menemani segala bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
(579, 59, 2, 'LENNOX BLACK/RED ', 'Low - Cut, Bahan PVC, Sol Rubber, Sepatu Bertali', '<p>\r\n	     Precise Lennox adalah Sepatu Olahraga - Hitam/Merah, merupakan sepatu yang diproduksi oleh Precise.Terbuat dari bahan PVC yang dilengkapi dengan sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan dasar yang digunakan dalam membuat sepatu ini merupakan material-material pilihan yang berkualitas sehingga sepatu menjadi awet dan tidak mudah rusak.Desainnya dibuat khusus untuk olahraga tennis dan kasual yang membuat sepatu ini cocok untuk menemani segala bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
(512, 78, 2, 'FREYA W BLACK ', 'Mid - Cut, Bahan canvas, Sol Rubber, Sepatu Bertali', '<p>\r\n	   Precise Kakkoii Freya adalah Sepatu Wanita - Hitam, merupakan sepatu yang diproduksi oleh Precise.Terbuat dari bahan canvas yang dilengkapi dengan sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan dasar yang digunakan dalam membuat sepatu ini merupakan material-material pilihan yang berkualitas sehingga sepatu menjadi awet dan tidak mudah rusak.Desainnya yang kasual membuat sepatu ini cocok untuk menemani segala bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
