(588, 106, 2, 'EVELYN W BLACK ', 'Low - Cut, Bahan mesh, Sol Rubber, Sepatu Bertali', '<p>\r\n	   Precise Evelyn adalah Sepatu Remaja Putri - Hitam, merupakan sepatu yang diproduksi oleh Precise.Terbuat dari bahan mesh yang dilengkapi dengan sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan dasar yang digunakan dalam membuat sepatu ini merupakan material-material pilihan yang berkualitas sehingga sepatu menjadi awet dan tidak mudah rusak.Desainnya yang kasual membuat sepatu ini cocok untuk menemani segala bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
(581, 113, 2, 'LUTHER NAVY/N GREEN FL ', 'Low - Cut, Bahan MESH, Sol Rubber, Sepatu Tennis Bertali ', '<p>\r\n	       Precise Luther Navy/N. Greem FL  - merupakan sepatu  tennis dengan  kombinasi warna navy dan Neon Green FL yang  diproduksi oleh Precise.  Terbuat dari bahan PVC yang dilengkapi dengan  sol berbahan rubber  membuat sepatu ini sangat nyaman digunakan.Bahan  dasar yang digunakan  dalam membuat sepatu ini merupakan  material-material pilihan yang  berkualitas sehingga sepatu menjadi awet  dan tidak mudah  rusak.Desainnya yang dibuat khusus dan kasual membuat  sepatu ini nyaman  untuk kegiatan olah raga Tennis dan cocok untuk menemani segala  bentuk  aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
(580, 114, 2, 'LUTHER BLACK/BLUE', 'Low - Cut, Bahan MESH, Sol Rubber, Sepatu Tennis Bertali ', '<p>\r\n	     Precise Luther Black/Blue  - merupakan sepatu  tennis dengan   kombinasi warna hitam dan biru yang  diproduksi oleh Precise.   Terbuat dari bahan PVC yang dilengkapi dengan  sol berbahan rubber   membuat sepatu ini sangat nyaman digunakan.Bahan  dasar yang digunakan   dalam membuat sepatu ini merupakan  material-material pilihan yang   berkualitas sehingga sepatu menjadi awet  dan tidak mudah   rusak.Desainnya yang dibuat khusus dan kasual membuat  sepatu ini nyaman   untuk kegiatan olahraga Tennis dan cocok untuk menemani segala   bentuk  aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
