(561, 112, 2, 'LUTHER NAVY/ORANGE FL ', 'Low - cut, Bahan PVC, Sol Rubber, Sepatu Tennis bertali ', '<p>\r\n	     Precise Luther Navy/Orange FL  - merupakan sepatu  tennis dengan kombinasi warna navy dan orange FL yang  diproduksi oleh Precise. Terbuat dari bahan PVC yang dilengkapi dengan  sol berbahan rubber membuat sepatu ini sangat nyaman digunakan.Bahan  dasar yang digunakan dalam membuat sepatu ini merupakan  material-material pilihan yang berkualitas sehingga sepatu menjadi awet  dan tidak mudah rusak.Desainnya yang dibuat khusus dan kasual membuat  sepatu ini nyaman untuk kegiatan olah raga Tennis dan cocok untuk menemani segala  bentuk aktivitas Anda sehari-hari.\r\n</p>', '', '', '', ''),
